import AppRoutes from './routes/AppRoutes';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import { Provider } from 'react-redux';

import store from './app/store';

function App() {
  return (
    <Provider store={store}>
      <AppRoutes />
      <Navbar />
      <Footer />
    </Provider>
  );
}

export default App;
